import React from 'react';
import { FadeIn } from 'react-slide-fade-in';
import profile_pic from '../contet/profile_pic.jpg';
import "../styles/home.css";
import { name, introduction, icons } from '../content/profile_info.js';

const makeIcon = (icon) => {
  return (
    <a key={icon.link} className={icon.className.includes("ai ai-") ? "icon ai-icon" : "icon"} href={icon.link}>
      <i className={icon.className}></i>
    </a>
  );
}

const Home = () => {
  return (
    <div id="home-div">
      <FadeIn
      durationInMilliseconds={500}
      >
        <h1 className="section-head">About</h1>
      </FadeIn>
      <FadeIn
      from="bottom"
      positionOffset={50}
      durationInMilliseconds={500}
      >
      <div id="intro-div">
        <div id="text-and-icons">
          {introduction}
          <div id="icons">
            {icons.map(makeIcon)}
          </div>
        </div>
        <img id="profile-pic" alt={name} src={amani_pic}/>
      </div>
      </FadeIn>
      </div>
  );
}

export default Home;
